import React, {useContext,useStyles} from 'react';

import {UserContext} from './UserContext';

const makeStyles = useStyles({
    root : {
        color: '#fffff',
    },
})

const Myresult = () => {

    const myshiZ = useContext(UserContext);
    const classes = useStyles();

    return (
        <div className={classes.dressing}>{myshiZ.choice}</div>
    )
}

export default Myresult
